import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";

ReactDOM.render(
  <>
    <Heading />
    <p> Mere doston ke naam</p>
    <ol>
      <li> yasir </li>
      <li> naveadf </li>
      <li> abdullah </li>
      <li> aneeq </li>
    </ol>
  </>,
  document.getElementById("root")
);
